import React from 'react';
import Navbar from './_share/Navbar.js';
import Main_content from './_share/Main_content.js';
import Footer from './_share/Footer.js';
// scss 
import '%PUBLIC_URL%/template_frontend/scss/_site-base.scss';
import '%PUBLIC_URL%/template_frontend/scss/_site-blocks.scss';
import '%PUBLIC_URL%/public/template_frontend/scss/_site-navbar.scss';
import '%PUBLIC_URL%/template_frontend/scss/style.scss';

const Customer_layout = () => {
	return (
		<div className="site-wrap">
			<Navbar />
			<Main_content />
			<Footer />
		</div>
	)
}

export default Customer_layout
